import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Nav from "./components/Nav"
import Countdown from "./components/Countdown"

function App() {
  return (
    <div className="App">
      <Nav/>
      <Countdown/>
    </div>
  );
}

export default App;
